CREATE PROCEDURE get_user_meal_plan(IN uid INT)
BEGIN
    
    SELECT *
    FROM
        meal_plans_with_planned_meals_agg m
    WHERE m.for_user=uid;
    
END //

DELIMITER ;

DELIMITER //

CREATE PROCEDURE get_user_shopping_list(IN uid INT)
BEGIN
    
    SELECT
        SUM(p.amount) amount_needed,
        si.stock_quantity,
        p.ingredient_id,
        p.ingredient_name
    FROM
        meal_plans_with_planned_meals p
    JOIN(
        SELECT
            s.user_id,
            s.stock_quantity,
            i.ingredient_id,
            i.ingredient_name
        FROM
            ingredient i
        JOIN(
            SELECT
                *
            FROM
                `in_stock` ist
            WHERE
                ist.user_id=usid
        ) s
    ON
        i.ingredient_id = s.ingredient_id
    ) si
    ON
        p.for_user = si.user_id AND p.ingredient_id=si.ingredient_id
    GROUP BY
        p.ingredient_id,
        si.stock_quantity;
    
END //

DELIMITER ;

DELIMITER //

CREATE PROCEDURE get_one_user(IN uid INT)
BEGIN
    
    SELECT * FROM user_allergy_joined_agg WHERE user_id=uid;
    
END //

DELIMITER ;

