CREATE PROCEDURE get_recipe_detail(IN rid INT)
BEGIN
    
    SELECT 
        ri.recipe_id,
        ri.recipe_name,
        ri.image_url,
        ri.prep_time,
        ri.cook_time,
        ri.creation_date,
        ri.culture,
        ri.description,
        ri.created_by,
        ri.instructions,
        JSON_ARRAYAGG(JSON_OBJECT(
            'ingredient_id',
            rimj.ingredient_id,
            'ingredient_name',
            rimj.ingredient_name,
            'amount',
            rimj.amount,
            'unit',
            rimj.unit,
            'allergy_id',
            rimj.allergy_id,
            'allergy_name',
            rimj.allergy_name,
            'calorie_count',
            rimj.calorie_count)) ingredient_measurements
    FROM
        ingredient_measurement_joined rimj
        JOIN
        (
            SELECT
                r.recipe_id,
                r.recipe_name,
                r.image_url,
                r.prep_time,
                r.cook_time,
                r.creation_date,
                r.culture,
                r.description,
                r.created_by,
                JSON_ARRAYAGG(
                    JSON_OBJECT(
                        'instruction_id',
                        instr.instruction_id,
                        'step_number',
                        instr.step_number,
                        'instruction_details',
                        instr.instruction_details
                    )
                ) instructions
            FROM recipe r JOIN instruction instr ON instr.recipe_id=r.recipe_id
            WHERE r.recipe_id=rid
            GROUP BY recipe_id
        ) ri
        ON ri.recipe_id=rimj.recipe_id
        GROUP BY ri.recipe_id;
    
END //

DELIMITER ;




























































































































































